import React from "react";
import { Container, Button} from "reactstrap";
import Particles from 'react-particles-js'
function IndexHeader() {
  return (
    <>
    <React.Fragment>
    <Particles params={{
	    "particles": {
	        "number": {
	            "value": 200,
	            "density": {
	                "enable": true
	            }
          },
          backgroundImage:{

          },
          color: {
            value: '#b61924'
          },
	        "size": {
	            "value": 10,
	            "random": true
	        },
	        "line_linked": {
	            "enable": false
	        }
	    },
	}} />

      <div
        className="page-header section-dark"
        style={{
          backgroundImage:
            "url(" + require("assets/img/bastion.jpg") + ")",
        }}
      >
        <div className="filter" />
        <div className="content-center">
          <Container>
            <div className="title-brand">
              <h1 className="presentation-title">Imminent</h1>
              {/* <div className="fog-low">
                <img alt="..." src={require("assets/img/fog-low.png")} />
              </div> */}
            </div>
            <h2 className="presentation-subtitle text-center"> 
               H Trypa tou TSOSOUA den exei oria
            </h2>
            <br/>
            <br/>
            <br/> 
            <br/>
            <br/>

              <Button href="https://docs.google.com/forms/u/1/d/1tZQHYzSwy39Wpy9mbi66nchmWwi6pWrPSP_0lLjtMzw" target="_blank" className="btn btn-default btn-framed"> Apply Now</Button> 
              <Button style={{margin:"50px"}} href="https://www.wowprogress.com/guild/eu/twisting-nether/Imminent" target="_blank" className="btn btn-default btn-framed"> WoW Progress</Button> 
              <Button style={{margin:"50 0 0 0"}} href="https://raider.io/guilds/eu/twisting-nether/Imminent" target="_blank" className="btn btn-default btn-framed"> Raider IO</Button> 

          </Container>
        </div>     
      </div>
      <Particles params={{
	    "particles": {
	        "number": {
	            "value": 200,
	            "density": {
	                "enable": true
	            }
          },
          color: {
            value: '#b61924'
          },
	        "size": {
	            "value": 10,
	            "random": true
	        },
	        "line_linked": {
	            "enable": false
	        }
	    },
	}} />

      </React.Fragment>
    </>
  );
}

export default IndexHeader;
